import React , {Fragment} from "react";
import styled from "styled-components";

const Container = styled.div`
  height: 30%;
  padding: 0 2rem;
  width: 100%;
  box-shadow: #e9e9e9 0px 1px 4px;
  margin: 30px 0;

`;

const SearchFormFields = [
    {
        type:'text',
        name:'transactionId',
        placeholder:'Search Trans Id',
        label:''
    }
]

export const FormGroup = styled.div`
  margin: 1.2rem 0;
`;
export const FormDesc = styled.h3`
  display: block;
  margin-top: 2rem;
  color: #888;
  @media (max-width: 480px) {
    align-self: center;
  }
  @media (max-width: 768px) {
    align-self: center;
  }
`;

export const Input = styled.input`
  display: block;
  padding: 0.4rem 3rem 0.4rem 0.8rem;
  font-size: 1rem;
  font-weight: 300;
  border: 1px solid #ccc;
  border-radius: 25px;
  width: 100%;
  @media (max-width: 480px) {
    text-align: ${({ isDisplayPage }) => (isDisplayPage ? "center" : "left")};
  }
  @media (max-width: 768px) {
    text-align: ${({ isDisplayPage }) => (isDisplayPage ? "center" : "left")};
  }
`;
const Search = () => {
  return (



      <Container>

<form>
        {SearchFormFields.map((formField, index) => {
          const { type, name, placeholder, label } = formField;
          return (
            <Fragment key={index}>
              <FormDesc>{label}</FormDesc>
              <FormGroup>
                <Input
                  type={type}
                  name={name}
                  onChange={(e) => onChange(e)}
                  placeholder={placeholder}
                  value={formData[name]}
                />
              </FormGroup>
            </Fragment>
          );
        })}
        {/* <Button onClick={(e) => onSubmit(e)}>
          Submit
        </Button> */}
      </form>
      </Container>

  );
};

export default Search;
